<FORM name="Tsubmit"  id="submissionForm" TYPE="POST" data-abide="ajax">
<div id="Ticketform" class="has-form">
<div class="medium-6">
  <div class="row collapse">
    <div class="medium-3 columns">
      <span class="prefix"><b>Priority</b></span>
  </div> 
  <span id='buttonDiv' class="medium-3">
    <input type="radio" NAME="priority" id="radio1" VALUE="2" checked /><label for="radio1" >2</label>
    <input type="radio" NAME="priority" id="radio2" VALUE="4" /><label for="radio2" >4</label>
    <input type="radio" NAME="priority" id="radio3" VALUE="9" /><label for="radio3">9</label>
  </span>
  </div>
</div>  
<div class="row collapse">
  <div class="small-3 large-2 columns">
      <span class="prefix">Ticket #</span>
    </div>
    <div class="small-9 large-10 columns">
      <INPUT TYPE="number" NAME="ticket" id="TicketNumber" tabindex="1" MAXLENGTH=6  placeholder="Ticket Number" required pattern="[0-9]{6}" >
	<small class="error">6 digits are required.</small>	
    </div>

  </div>

<div class="row collapse">
  <div class="small-3 large-2 columns">
       <span class="prefix">Site Name</span>
    </div>
    <div class="small-9 large-10 columns">
      <INPUT TYPE="text" NAME="siteName" id="SiteName" MAXLENGTH=45 placeholder="Site Name" tabindex="2" required pattern="^.*$">
	  <small class="error">Site Name is required.</small>
    </div>
   </div>
    <label for="Comments" class="primary label">Notes:</label>
      <TEXTAREA type="text" id="comments" NAME="Comments" cols=20 rows=5 scrolling="no" VALUE="COMMENTS" tabindex="3" placeholder="Please enter any comments."></TEXTAREA>

<label id='Ccontact' for='picker' class="primary label">Contact via:</label>
<div class='picker'>
<select name='ContactPref' id='cPreference' tabindex='4'>
<option value='phone' selected>Phone</option>
<option value='email'>E-mail</option>
</select>
</div>
</FORM>
<Button TYPE="submit" NAME="submit"  VALUE="Submit" id="SubButton" class="button small primary"><img src="/icons/package_add.png" title="Submit!" /> Submit Ticket</button>
&nbsp;<Button TYPE="reset" id="reset" NAME="Reset" VALUE="Reset" class="button small secondary"><img src="/icons/page_refresh.png" title="Reset form" /> Reset</button>
</div>


